import Link from "next/link";

const Navbar = () => {
  const navStyle = {
    background:"grey"
  }
  return (
  <div style={navStyle}>
    <Link href="/about"><a>About Page</a></Link>
    <Link href="/contact"><a>Contact Page</a></Link>
  </div>
  )
};

export default Navbar;
